import React, { Component } from 'react';
import './App.css';
import axios from 'axios';
import Greet from './components/greet'
import Header from './components/header'


class App extends Component{
  constructor(props) {
    super(props);
    this.state = {
      myElement: null,
    };
  }

  componentDidMount() {
    axios.get('http://localhost:3000/admin/')
      .then(response => {
        const myElement = response.data;
        // Do something with the retrieved element, e.g. update the state of a React component
      })
      .catch(error => {
        console.log(error);
      });


  return (
    <div className="App">
      <Greet />

      <Header />
    </div>
  );
  }
}

export default App;
